"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[7993],{2925:e=>{e.exports=JSON.parse('{"label":"sequence-models","permalink":"/tags/sequence-models","allTagsPath":"/tags","count":6,"items":[{"id":"learning/deep-learning/sequence-models.mdx/models-and-attention","title":"Models and Attention","description":"\u672c\u6587\u4ecb\u7d39\u4e86 Seq2Seq \u6a21\u578b\u4ee5\u53ca\u5982\u4f55\u4f7f\u7528 Beam Search \u7684\u65b9\u6cd5\u4f86\u627e\u51fa\u6700\u53ef\u80fd\u7684\u53e5\u5b50\uff0c\u4e26\u4ecb\u7d39\u4e86\u5982\u4f55\u4f7f\u7528 Length Normalization \u4f86\u512a\u5316 Beam Search\u3002\u6b64\u5916\uff0c\u672c\u6587\u4e5f\u4ecb\u7d39\u4e86 Attention Model\uff0c\u5b83\u53ef\u4ee5\u6539\u5584 Seq2Seq \u6a21\u578b\u5728\u8655\u7406\u9577\u5ea6\u8f03\u5927\u53e5\u5b50\u6642\u7684\u8a18\u61b6\u529b\u4e0d\u8db3\uff0c\u4e26\u4e14\u53ef\u4ee5\u7528\u5728 Machine Translation\u3001Speech Recognition \u4ee5\u53ca Trigger Word Detection \u7b49\u4efb\u52d9\u4e0a\u3002Attention Model \u80fd\u5920\u8b93\u7db2\u8def\u50cf\u4eba\u985e\u4e00\u6a23\u53bb\u8655\u7406\u53e5\u5b50\uff0c\u5728\u7ffb\u8b6f\u6bcf\u4e00\u500b\u55ae\u5b57\u6642\uff0c\u6ce8\u610f\u5230\u6b63\u78ba\u7684\u539f\u55ae\u5b57\u3002","permalink":"/learning/deep-learning/sequence-models.mdx/models-and-attention"},{"id":"learning/deep-learning/sequence-models.mdx/nlp-and-word-embeddings","title":"NLP and Word Embeddings","description":"\u672c\u6587\u8a0e\u8ad6\u4e86 NLP \u4e2d\u7684 Word Embedding \u6280\u8853\uff0c\u662f\u4e00\u7a2e\u6539\u826f\u4e86 one-hot vector \u7684\u5b57\u8a5e\u8868\u793a\u6cd5\uff0c\u5c07\u55ae\u8a5e\u6295\u5f71\u5230\u4e00\u500b\u9ad8\u7dad\u5ea6\u7a7a\u9593\u4e2d\u7684\u8868\u793a\u65b9\u6cd5\uff0c\u8b93 model \u53ef\u4ee5\u8868\u9054\u51fa\u5404\u500b\u5b57\u8a5e\u4e4b\u9593\u7684\u95dc\u806f\u6027\u3002Word Embeddings \u53ef\u4ee5\u4f7f\u7528\u65bc Transfer Learning \u4f86\u64f4\u5927 model \u7684\u80fd\u529b\uff0c\u4ee5\u53ca\u53ef\u4ee5\u57f7\u884c Analogy Reasoning \u4f86\u5c0b\u627e\u5b57\u8a5e\u4e4b\u9593\u7684\u985e\u4f3c\u95dc\u4fc2\u3002","permalink":"/learning/deep-learning/sequence-models.mdx/nlp-and-word-embeddings"},{"id":"learning/deep-learning/sequence-models.mdx/recurrent-neural-networks/recurrent-neural-networks","title":"Recurrent Neural Networks","description":"\u9019\u500b\u7ae0\u7bc0\u6703\u63a2\u8a0e\u4e86 Recurrent Neural Networks (RNNs) \u7684\u6982\u5ff5\uff0c\u4ecb\u7d39\u4e86\u5982\u4f55\u4f7f\u7528\u6a19\u793a (notation) \u4f86\u6a19\u8a18\u51fa\u8f38\u5165\u53ca\u8f38\u51fa\uff0c\u4ee5\u53ca\u5982\u4f55\u5efa\u7acb\u4e00\u500b\u5b57\u5178\u4f86\u5c0d\u61c9\u6bcf\u500b\u55ae\u5b57\u3002\u63a5\u8457\u6703\u8a0e\u8ad6\u4f7f\u7528 RNNs \u9032\u884c forward propagation \u8207 backpropagation through time \u7684\u6982\u5ff5\u3002\u6b64\u5916\uff0c\u9084\u6703\u4ecb\u7d39 RNN \u7684 GRU \u548c LSTM \u6a21\u578b\uff0c\u4ee5\u53ca\u4f7f\u7528 peephole connection \u4f86\u64f4\u5c55 LSTM\u3002\u9084\u6709 BRNN \u89e3\u6c7a\u55ae\u65b9\u5411 RNN \u7121\u6cd5\u8655\u7406\u4e00\u4e9b\u554f\u984c\u7684\u554f\u984c\uff0c\u548c\u6709\u591a\u500b hidden layers \u7684 DRNN \u53ef\u4ee5\u66f4\u6709\u6548\u7387\u7684\u8655\u7406 sequence data\u3002","permalink":"/learning/deep-learning/sequence-models.mdx/recurrent-neural-networks/"},{"id":"learning/deep-learning/sequence-models.mdx/recurrent-neural-networks/rnn-models","title":"RNN Models","description":"\u672c\u6587\u4e3b\u8981\u4ecb\u7d39 Gated Recurrent Unit (GRU) \u548c Long Short Term Memory (LSTM) \u9019\u5169\u7a2e Recurrent Neural Network (RNN) \u6a21\u578b\u7684\u67b6\u69cb\u53ca\u5176\u539f\u7406\u3002GRU \u5c07 basic RNN \u7684\u7d50\u69cb\u52a0\u4e0a\u4e00\u500b memory cell \u4f86\u89e3\u6c7a vanishing gradients \u7684\u554f\u984c\uff0c\u800c LSTM \u5247\u662f\u6539\u9032 GRU\uff0c\u5c07 basic RNN \u7684\u7d50\u69cb\u66f4\u9032\u4e00\u6b65\u52a0\u4e0a\u4e09\u500b gates \u4f86\u89e3\u6c7a vanishing gradients \u548c long-term dependency \u7684\u554f\u984c\u3002\u6b64\u5916\uff0c\u4e5f\u4ecb\u7d39\u4e86 Bidirectional RNN (BRNN) \u548c Deep RNNs (DRNN)\uff0cBRNN \u80fd\u5920\u96d9\u5411\u8655\u7406\u53e5\u5b50\uff0c\u800c DRNN \u5247\u662f\u5c07 RNN \u7684 hidden layers \u6578\u76ee\u589e\u52a0\u3002","permalink":"/learning/deep-learning/sequence-models.mdx/recurrent-neural-networks/rnn-models"},{"id":"learning/deep-learning/sequence-models.mdx/recurrent-neural-networks/sequence-models","title":"Sequence Models","description":"Sequence data \u6307\u7684\u662f\u4e00\u9023\u4e32\u7684 data\uff0c\u4f8b\u5982\u8f38\u5165 input \u4e00\u9023\u4e32\u8072\u97f3 output \u6210\u6587\u5b57\uff08\u8a9e\u97f3\u8b58\u5225\uff09\uff0c\u6211\u5011\u8981\u5229\u7528 Recurrent Neural Network (\u5faa\u74b0\u795e\u7d93\u7db2\u8def) \u4f86\u5efa\u7acb\u51fa sequence model\u3002","permalink":"/learning/deep-learning/sequence-models.mdx/recurrent-neural-networks/sequence-models"},{"id":"learning/deep-learning/sequence-models.mdx/sequence-models","title":"Sequence Models","description":"\u5728 Sequence Models \u4e2d\uff0c\u6211\u5011\u5c07\u6703\u5b78\u7fd2\u5982\u4f55\u5efa\u7acb Natural Language\u3001Audio \u6216\u5176\u4ed6 Sequence Data \u7684\u6a21\u578b\u3002\u7531\u65bc\u6709 Deep Learning\uff0cSequence Algorithms \u624d\u80fd\u5920\u5feb\u901f\u9032\u6b65\uff0c\u5176\u4e2d\u7684\u5c08\u6848\u5305\u62ec\uff1aSpeech Recognition\u3001Music Synthesis\u3001Chatbots\u3001Machine Translation\u3001Natural Language Understanding \u7b49\u7b49\u3002","permalink":"/learning/deep-learning/sequence-models.mdx/"}]}')}}]);